import {Component} from 'react'

import Layout from './component/Layout'


class Index extends Component {

    constructor(props) {
        super(props);

    }



    render() {

        return (
            <div className="d-flex justify-content-between " style={{flex:1, flexDirection:'column', height: '100vh', width:'100%', backgroundColor:'rgba(239, 241, 244, 1)'}}>

                <Layout/>

                <div>
                    Home
                </div>



            </div>
        );

    }
} 

export default Index;
